import styled from 'styled-components';
import Head from 'next/head';
import Header from '../components/Header';

const ContactStyles = styled.div`
  display: grid;
  grid-template-columns: 1fr 3fr 1fr;
  grid-template-rows: auto 60px 50vh;
  align-items: center;
  #header {
    grid-column: 1 / 4;
    grid-row: 1;
  }
  #title {
    grid-column: 2;
    grid-row: 2;
  }
  #contact {
    grid-column: 2;
    grid-row: 3;
    padding-bottom: ;
  }
`;
export default function ContactPage() {
  return (
    <ContactStyles>
      <Head>
        <title>Ataire | Contact Ataire</title>
      </Head>
      <div id="header">
        <Header />
      </div>
      <div id="title">
        <h1>Contact Us!</h1>
      </div>
      <div id="contact">
        <p>
          Ataire, 1557 London Road, Norbury London, SW16 4AD, Tell +442038932944
        </p>
        <a href="mailto:Ataire.online@gmail.com">Email Ataire</a>
      </div>
    </ContactStyles>
  );
}
